  def test_checksum_field
    session = FIX::Session.new("FIX.4.2", "etc/FIX42.xml")
    assert_equal("10=104", FIX::Message.new(session, "Logon").send(:checksum_field, "hello world, test"))
  end

  def test_msg_to_string
    session = FIX::Session.new("FIX.4.2", "etc/FIX42.xml")
    session.properties['SenderCompID'] = "TestSender"
    session.properties['TargetCompID'] = "TestTarget"
    session.properties['EncryptMethod'] = "0"
    session.properties['HeartBtInt'] = "60"

    str = "8=FIX.4.2\x019=13\x0135=A\x01444=555\x0110=090\x01"
    message = FIX::Message.new(session, "Logon").add_field("444", "555")
    assert_equal(str, message.send(:msg_to_string))

    str = "8=FIX.4.2\x019=22\x0135=A\x01444=555\x0196=world\x0110=047\x01"
    message = FIX::Message.new(session, "Logon").add_field("444", "555").add_field("96", "world")
    assert_equal(str, message.send(:msg_to_string))

    str = "8=FIX.4.2\x019=22\x0135=A\x01444=555\x0196=world\x0110=047\x01"
    message = FIX::Message.new(session, "Logon").add_field("ListStatusText", "555").add_field("RawData", "world")
    assert_equal(str, message.send(:msg_to_string))

    str = "8=FIX.4.2\x019=22\x0135=A\x01444=555\x0196=world\x0110=047\x01"
    message = FIX::Message.new(session, "Logon", {"ListStatusText" => "555", "RawData" => "world"})
    assert_equal(str, message.send(:msg_to_string))
  end
